import React from 'react'
import styled from 'styled-components'


const Boxes = styled.div`
    background-color:green ;
    height: 210px ;
    width: 210px ;
    margin-top:150px ;
    margin-left:90px ;
    /* position: absolute ; */
    cursor: pointer;
    transition: .5s ease-in-out ;

    &:hover{
        background-color:black ;
    }
    
`
const Title = styled.h3`
    font-size: 24px;
    text-align:center;
    color: gray
`
const Box = ({item}) => {
  return (
    <Boxes>
        <Title>{item.title}</Title>
    </Boxes>
  )
}

export default Box
